                        <p><input type='text' placeholder="token" name='buy' /></p>
                        <p><input type='text' placeholder="trade for" name='buy' /></p>
                        <p><input type='number' placeholder="amount" name='buy' /></p>
                        <p><input type='number' placeholder="ask price" name='buy' /></p>
                        <p><button className="sell-button-badge"> Ask </button></p>
                    </form>
                </div>
            </div>
        )
    }
}

export default InputForm
